import proj1 from "../assets/travelrecs_home.png";
import proj2 from "../assets/mqdefault.jpg";
import proj3 from "../assets/mqdefault.jpg";

const ProjectCardData = [
    {
        imgsrc: proj1,
        title: "TravelRecs",
        text: "Travel recommendation application made for CS 1530: Software Engineering at the University of Pittsburgh\
        -- utilizes Django and was created as a part of learning about teamwork in an Agile scrum environment. Takes data \
        from a custom dataset and outputs recommendations based on user input.",
        view: "https://www.sci.pitt.edu/academics/undergraduate-majors/computer-science",
        source: "https://github.com/jennncao/TravelRecs",
    }, 
    {
        imgsrc: proj2,
        title: "Frog 1",
        text: "a good frog i think",
        view: "https://www.sci.pitt.edu/academics/undergraduate-majors/computer-science",
    },
    {
    imgsrc: proj3,
        title: "The \"Best\" Neighborhood",
        text: "a good frog i think",
        view: "https://www.sci.pitt.edu/academics/undergraduate-majors/computer-science",
        source: "https://github.com/jennncao/Final-Project-Group-49",
    },
];

export default ProjectCardData;
